import React, {Component} from 'react';
import axios from 'axios';

export default class ReadDesc extends Component {

    constructor(props) {
        super(props);
        this.state = {description: []};
    }

    componentDidMount() {
        axios.get('http://localhost:4000/td/'+this.props.match.params.id)
            .then(response => {
                this.setState({description: response.data});
            })
            .catch(function (error) {
                console.log(error);
            })
    }

    render() {
        return (
            <div style={{ marginTop: 20 }}>
                <h3>Cat√°logo</h3>
                <table className="table table-dark" style={{ marginTop: 20 }}>
                    <thead>
                        <tr>
                            <th>Context</th>
                            <th>ID</th>
                            <th>Title</th>
                            <th>Security Definitions</th>
                            <th>Security</th>
                            <th>Properties</th>
                            <th>Actions</th>
                            <th>Events</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>{this.state.description.context}</td>
                            <td>{this.state.description.id}</td>
                            <td>{this.state.description.title}</td>
                            <td>{JSON.stringify(this.state.description.securityDefinitions, null, 2)}</td>
                            <td>{JSON.stringify(this.state.description.security, null, 2)}</td>
                            <td>{JSON.stringify(this.state.description.properties,null)}</td>
                            <td>{JSON.stringify(this.state.description.actions, null)}</td>
                            <td>{JSON.stringify(this.state.description.events, null)}</td>
                        </tr>
                    </tbody>
                </table>
            </div>
        )
    }
}
